item.description:
In HubSpot, [leads](https://knowledge.hubspot.com/prospecting/set-up-leads) are contacts or companies that are potential customers who have shown interest in your products or services. The leads endpoints allow you to create and manage lead records in your HubSpot account, as well as sync lead data between HubSpot and other systems.

Before using the API, be sure leads have been [set up in your account](https://knowledge.hubspot.com/prospecting/set-up-leads). 

Learn more about objects, records, properties, and associations APIs in the [Understanding the CRM](https://developers.hubspot.com/docs-beta/crm/understanding-the-crm?_ga=2.21847609.341006870.1586180142-500942594.1573763828) guide. For more general information about objects and records in HubSpot, [learn how to manage your CRM database](https://knowledge.hubspot.com/contacts-user-guide?utm_campaign=UserGuides&utm_source=Developers&_ga=2.22901305.341006870.1586180142-500942594.1573763828).

## Create leads

To create new contacts, make a `POST` request to `/crm/v3/objects/leads`.

In the request body, include any details about the lead in a `properties` object. Your new lead:

- Must have a lead name, specified using the hs_lead_name property.

- Must be associated with an existing contacts. 

- Should only be assigned to a user with a [seat](https://knowledge.hubspot.com/account-management/manage-seats). (Leads can only be worked via the workspace).

- For example, to create a warm lead named “Jane Doe” who has a type of New Business, your request body would resemble the following:


JSON

```
// Example POST request to /crm/v3/objects/leads
"associations": [
{
"types": [
{
"associationCategory": "HUBSPOT_DEFINED",
"associationTypeId":578
}
],
"to": {
"id": "YOUR_CONTACT_ID"
}
}
]
"properties": {
  "hs_lead_name": "Jane Doe",
  "hs_lead_type": "NEW BUSINESS",
  "hs_lead_label": "WARM"
}

 ```

