item.description:
When you're [creating a quote in HubSpot](https://developers.hubspot.com/docs/api/crm/quotes), you can create and associate a tax as part of the pricing details of the quote.

## Create a tax

Taxes are used in conjunction with [discounts](https://developers.hubspot.com/docs/api/crm/discounts) and [fees](https://developers.hubspot.com/docs/api/crm/fees) when determining the pricing details for a quote. Any discounts you associate with your quote will be applied first, followed by associated fees, and then any associated taxes will apply.

JSON

```
// POST request to https://api.hubspi.com/crm/v3/objects/tax
{
  "properties": {
    "hs_label": "A percentage-based tax of 6.5%",
    "hs_type": "PERCENT",
    "hs_value": "6.5"
  }
}

 ```

Copy

After you create a tax, you can use its ID to associate it with a quote. To retrieve a list of taxes you've created, you can make a `GET` request to `/crm/v3/objects/tax`.

